import React, { Component } from "react";
import SearchBar from "../../components/SearchBar"
import { Table } from "react-bootstrap"
import axios from 'axios'
class SubjectManagement extends Component {

	constructor(props) {
		super(props);
		this.state = {
			trademarks: [],
			products: []
		}
	}

	componentDidMount() {
		axios({
			method: 'GET',
			url: 'http://localhost:5000/api/trademarks',
			data: null
		}).then(res => {
			console.log(res);
			this.setState({
				trademarks: res.data
			});
		}).catch(err => {
			console.log(err);
		})
		axios({
			method: 'GET',
			url: 'http://localhost:5000/api/products',
			data: null
		}).then(res => {
			console.log(res);
			this.setState({
				products: res.data
			});
		}).catch(err => {
			console.log(err);
		})
	}

	render() {
		return (
			<div>
				<h2>Danh sách môn học</h2>
				<SearchBar />
				<Table striped bordered hover variant="dark" style={{ width: "100%", marginTop: "1rem" }} >
					<thead>
						<tr>
							<th>STT</th>
						</tr>
					</thead>
					<tbody>
						<tr>
							<td>1</td>
							<td>DLCMDCSVN</td>
							<td style={{ textAlign: "right" }}><a href="/thoikhoabieu">Xem chi tiết</a></td>
						</tr>
						<tr>
							<td>2</td>
							<td>Toán cao cấp</td>
							<td style={{ textAlign: "right" }}><a href="/thoikhoabieu">Xem chi tiết</a></td>
						</tr>
						<tr>
							<td>3</td>
							<td>Giải phẫu</td>
							<td style={{ textAlign: "right" }}><a href="/thoikhoabieu">Xem chi tiết</a></td>
						</tr>
						<tr>
							<td>4</td>
							<td>Đại số tuyến tính</td>
							<td style={{ textAlign: "right" }}><a href="/thoikhoabieu">Xem chi tiết</a></td>
						</tr>
						<tr>
							<td>5</td>
							<td>Giải tích</td>
							<td style={{ textAlign: "right" }}><a href="/thoikhoabieu">Xem chi tiết</a></td>
						</tr>
					</tbody>
				</Table>
			</div>
		)
	}

}
export default SubjectManagement;
